import { FC } from "react";
import { useParams } from "react-router-dom";
import Navbar from "../components/Navbar/Navbar";

const ProjectPage: FC = () => {
    const { project } = useParams();
    return (
        <div>
            <Navbar />
            <h1>{ project }</h1>
        </div>
    )
};

export default ProjectPage;
